    );

    const resultScreen = (
        <>world</>
    );

    const errorScreen = (
        <>error</>
    );

    return (
        <div className='Content'>
            {screen === 'main'? mainScreen : screen === 'result' ? resultScreen : errorScreen}
        </div>
    );
}


